import React from 'react';

const ContactForm = () => {
    return(

      <div className="ContactForm">

          <h1> 2. Stuur de professional een bericht </h1>

          <p> Kies in de linkerkolom de professional die u een bericht wilt sturen.
              <br/>
              Vul het formulier in ne kilk op verzenden
          </p>

          <form className="inputContainer">
              <input placeholder="Naam"/>
              <input placeholder="E-mailadres"/>
              <input placeholder="Telefoonnummer"/>
              <input placeholder="Type hier je bericht"/>
          </form>

      </div>

    );
}

export default ContactForm;
